import { useNavigate } from 'react-router-dom';

export default function RegisterButton() {
  const navigate = useNavigate();

  const handleRegister = () => {
    navigate.push='/home';
  };

  return <button type="submit" defaultValue="Registrar" className="button--general login-btn" onClick={handleRegister()}>Registrarse</button>;
}
